Instances can be created and destroyed using an HTTP API. GET https://playground-staging.substrate.dev/api/
POST https://playground-staging.substrate.dev/api/?template=node-template
GET https://playground-staging.substrate.dev/api/$INSTANCE_UUID
DELETE https://playground-staging.substrate.dev/api/$INSTANCE_UUID A local instance identified by its UUID can be manipulated: const instance = new Instance($UUID);
await instance.list(); //["vscode.open", ...]
await instance.execute("vscode.open", "/some/path"); Local instances can be discovered: const discoverer = new Discoverer((instance: Instance) => { console.log(`New instance discovered ${instance.uuid}`);
});
console.log(discoverer.instances);
